import React, { useState } from "react";
import './ArtistDetailModal.css'

function ArtistDetailModal(props) {
    const [show, setShow] = useState(props.state)

    return (
        <div>
        {show && 
            <div id="modal-body">
                <h1>{props.name}</h1>
            </div>
        }
        </div>
    )
}

export default ArtistDetailModal
